INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES (1308, 7, "ht_bTwo Celery Bisqued_ht_bDirections:ht_ulht_liIn a soup pot, melt the butter and cook the bacon for a few minutes without browning. Add the leek, onion, celery and bay leaf. Sweat for about 10 minutes without browning d_ht_liht_liAdd the celeriac and sweat another 5 minutes. Add the stock and potatoes and bring to a full boil. Reduce the heat, cover and simmer about 30 minutes. Remove the bay leaf d_ht_liht_liBlend the soup until smooth and strain to remove the fibers. Season to taste and adjust the consistency with a little milk, if necessary d_ht_liht_liJust before serving, reheat the soup on the stovetop and when it is very hot, add the cheese, whisking until it melts. Serve immediately, garnished with croutons and celery leaves d_ht_lid_ht_ulIngredients:ht_ulht_li45 ml (3 tbsp) salted butterd_ht_liht_li4 bacon slices cut in small stripsd_ht_liht_li1 leek, white part only, sliced thinlyd_ht_liht_li375 ml (1 1/2 cup) onion, choppedd_ht_liht_li3 celery stalks sliced thinlyd_ht_liht_li1 bay leafd_ht_liht_li800 g (1 lb 12 oz) celeriac, peeled, cut in 1 cm (1/2 in) diced_ht_liht_li1.25 L (5 cups) chicken stockd_ht_liht_liTo taste freshly ground salt and pepperd_ht_liht_li150 g (250 ml /1 cup) Saputo smoked Caciocavallo cheese, gratedd_ht_liht_liSufficient quantity of croutonsd_ht_liht_liSufficient quantity of celery heart leavesd_ht_lid_ht_ul");
